import actionType from "./actionType";
import axios from "axios";

export const setDetailData = () => {
    return (dispatch) => {
            axios.get("/api/detail.json").then(()=>{
                console.log("hello");
            }).catch(()=>{
                console.log("detail: error");
            })
        }
    
}
